	@Test
	public void getPostByUserMail() {
		Users user = new Users("xiaoyi3@example.com", null, null, null, null, null, null, null, null);
		String userMail = "xiaoyi10@example.com";
		PostListRes res = postService.getPostByMail(userMail, user.getUserMail());
		for (PostList item : res.getPostList()) {
			System.out.println(item.getUserMail());
			System.out.println(item.getJourneyId());
			System.out.println(item.getPostId());
			System.out.println(item.getJourneyName());
			System.out.println(item.getThumbDown());
			System.out.println(item.getThumbUp());
			System.out.println(item.getFavorite());
		}
	}

